import React from 'react';
import './profile.css';

function Profile() {
  return (
    <div className="container">
      <div className="profile">
        <div className="profile-picture">
          <img src="https://via.placeholder.com/150" alt="Profile" />
        </div>
        <div className="profile-info">
          <h1>My Profile Page</h1>
          <h2>Name</h2>
          <p>John Doe</p>
          <h2>Location</h2>
          <p>New York, NY</p>
          <h2>Bio</h2>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed euismod euismod mauris, vel malesuada neque gravida vitae.</p>
        </div>
      </div>
    </div>
  );
}

export default Profile;
